CREATE TABLE IF NOT EXISTS `admin` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '管理员自增ID',
  `name` varchar(32) NOT NULL COMMENT '名称',
  `password` varchar(32) NOT NULL COMMENT '密码',
  `last_login_ip` varchar(20) NOT NULL COMMENT '上次登录IP地址',
  `last_login_time` datetime NOT NULL COMMENT '上次登录时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COMMENT='管理员表' AUTO_INCREMENT=2 ;






CREATE TABLE IF NOT EXISTS `checkrecord` (
  `record_id` int(8) NOT NULL AUTO_INCREMENT COMMENT '考勤记录自增ID',
  `tech_id` int(8) NOT NULL COMMENT '考勤教师ID',
  `lesson_id` int(8) NOT NULL COMMENT '课程ID',
  `record_time` datetime NOT NULL COMMENT '考勤时间',
  `record_class` varchar(32) NOT NULL COMMENT '班级',
  `record_come` tinyint(3) NOT NULL DEFAULT '0' COMMENT '签到人数',
  `record_uncome` tinyint(3) NOT NULL DEFAULT '0' COMMENT '未到人数',
  `record_info` text NOT NULL COMMENT '未到学生信息',
  PRIMARY KEY (`record_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COMMENT='考勤记录表' AUTO_INCREMENT=22 ;





CREATE TABLE IF NOT EXISTS `lesson` (
  `lesson_id` int(8) NOT NULL AUTO_INCREMENT COMMENT '课程ID',
  `lesson_name` varchar(255) NOT NULL COMMENT '课程名称',
  `lesson_teacher` varchar(64) NOT NULL COMMENT '课程老师',
  `lesson_xuefen` int(8) NOT NULL COMMENT '课程学分',
  `lesson_address` varchar(255) NOT NULL COMMENT '上课地点',
  `xy_id` int(8) NOT NULL COMMENT '学院ID',
  PRIMARY KEY (`lesson_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=6 ;






CREATE TABLE IF NOT EXISTS `student` (
  `uid` int(10) NOT NULL COMMENT '学号',
  `name` varchar(32) NOT NULL COMMENT '姓名',
  `sex` varchar(8) NOT NULL COMMENT '性别',
  `xueyuan` varchar(64) NOT NULL COMMENT '学院',
  `zhuanye` varchar(64) NOT NULL COMMENT '专业',
  `class` varchar(32) NOT NULL COMMENT '行政班',
  `grade` varchar(8) NOT NULL COMMENT '年级',
  `year` varchar(8) NOT NULL COMMENT '学制',
  `zynum` varchar(8) NOT NULL COMMENT '专业代码',
  `type` varchar(32) NOT NULL COMMENT '层次',
  `long_num` varchar(12) NOT NULL COMMENT '长号',
  `email` varchar(255) NOT NULL COMMENT 'email地址',
  PRIMARY KEY (`uid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='学生信息表';




CREATE TABLE IF NOT EXISTS `teacher` (
  `tech_id` int(8) NOT NULL AUTO_INCREMENT COMMENT '教师ID',
  `xy_id` int(8) NOT NULL COMMENT '学院id',
  `tech_name` varchar(32) NOT NULL COMMENT '老师名字',
  `token` varchar(32) NOT NULL COMMENT '校验码',
  `password` varchar(32) NOT NULL COMMENT '密码',
  `tech_status` int(3) NOT NULL DEFAULT '1' COMMENT '状态，0为冻结，1为正常',
  PRIMARY KEY (`tech_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=6 ;




CREATE TABLE IF NOT EXISTS `xueyuan` (
  `xy_id` int(8) NOT NULL AUTO_INCREMENT COMMENT '学院自增ID',
  `xy_name` varchar(64) NOT NULL COMMENT '学院名称',
  PRIMARY KEY (`xy_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COMMENT='学院列表' AUTO_INCREMENT=17 ;






CREATE TABLE IF NOT EXISTS `zhuanye` (
  `z_id` int(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '专业课自增ID',
  `z_teachnum` varchar(10) NOT NULL COMMENT '教学计划号',
  `z_xiaoqu` varchar(16) NOT NULL COMMENT '校区',
  `z_year` varchar(8) NOT NULL COMMENT '开设时间',
  `z_zhuanye` varchar(32) NOT NULL COMMENT '专业名称',
  `z_type` varchar(12) NOT NULL COMMENT '层次',
  `z_class_num` varchar(8) NOT NULL COMMENT '班级数',
  `z_lesson_num` varchar(8) NOT NULL COMMENT '正式课程数',
  `xy_id` int(8) NOT NULL COMMENT '学院ID',
  PRIMARY KEY (`z_id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COMMENT='专业计划' AUTO_INCREMENT=578 ;






CREATE TABLE IF NOT EXISTS `zhuanyelesson` (
  `l_teach` varchar(32) NOT NULL COMMENT '校区',
  `l_teachnum` varchar(16) NOT NULL COMMENT '教学计划号',
  `l_zhuanye` varchar(32) NOT NULL COMMENT '专业名称',
  `l_classname` varchar(32) NOT NULL COMMENT '班级名称',
  `l_person_num` varchar(32) NOT NULL COMMENT '人数',
  `l_lesson_code` varchar(32) NOT NULL COMMENT '课程代码',
  `l_lesson_name` varchar(32) NOT NULL COMMENT '课程名称',
  `l_teacher_num` varchar(32) NOT NULL COMMENT '教师职工号',
  `l_teacher_name` varchar(32) NOT NULL COMMENT '教师姓名',
  `l_type` varchar(12) NOT NULL COMMENT '职称',
  `l_lesson_num` varchar(128) NOT NULL COMMENT '选课课号',
  `l_per_week_time` varchar(32) NOT NULL COMMENT '周学时',
  `l_during` varchar(12) NOT NULL COMMENT '起止周',
  `l_mark` varchar(12) NOT NULL COMMENT '学分',
  `l_sum_time` varchar(32) NOT NULL COMMENT '总学时',
  `l_lesson_type` varchar(32) NOT NULL COMMENT '课程性质',
  `l_lesson_kind` varchar(32) NOT NULL COMMENT '课程类别',
  `l_lesson_do` varchar(255) NOT NULL COMMENT '上课时间',
  `l_lesson_where` varchar(255) NOT NULL COMMENT '上课地点',
  `l_student_xueyuan` varchar(32) NOT NULL COMMENT '学生学院',
  `l_lesson_k` varchar(32) NOT NULL COMMENT '课程类别',
  `id` int(8) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COMMENT='专业班级课程表' AUTO_INCREMENT=3108 ;

